    false,nt"url": null,nt"notes": "This annual narrative report for Fish Springs
    National Wildlife Refuge outlines Refuge accomplishments from 2010-2012. This combined
    Annual Narrative Report covers the years 2010-12. It is intended to benefit current
    and future management of Fish Springs NWR by providing supplemental reporting information
    to that being provided by the required Annual Water Use Report, Annual Habitat Work
    Plan/Report, and other database reporting such as RAPP. To eliminate duplicative
    effort, the Annual Narrative Report references these other planning and reporting
    documents where appropriate Topics covered in this narrative include planning, administration,
    habitat management, wildlife, public use, and equipment and facilities.",nt"owner_org":
